import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import b2cauth from 'react-azure-adb2c';
import AuthB2C from './utils/AuthB2C'

b2cauth.initialize({
    instance: 'https://login.microsoftonline.com/tfp',
    tenant: 'b2cmern.onmicrosoft.com',
    signInPolicy: 'B2C_1_signupsignin',
    applicationId: 'ce5d1a2b-20a7-4f63-adde-6f0168cc29e5',
    cacheLocation: 'sessionStorage',
    scopes: ['https://b2cmern.onmicrosoft.com/mern/user_impersonation'],
    redirectUri: 'http://localhost:3000',
    postLogoutRedirectUri: window.location.origin,
});


b2cauth.run(() => {
    ReactDOM.render(<App />, document.getElementById('root'));
});


const auth = new AuthB2C();

if (auth.isLoggedIn()) {
  console.log(auth.currentUser());
} else {
    console.log('Not logged');
}
